1. There are 30 cars in total.
2. All cars are either red or white.
3. $\frac{1}{3}$ of the cars are red.
4. $50\%$ of the cars are 4-door.
5. 8 of the cars are 2-door and white.
6. We want to find the number of 4-door and red cars.

Let's denote the number of 4-door and red cars as $x$. Since $\frac{1}{3}$ of the cars are red, there are $10$ red cars in total. So, there are $10-x$ red 2-door cars.

Since $50\%$ of the cars are 4-door, there are $15$ 4-door cars in total. Since there are $10$ red cars, that means there are $15-x$ 4-door cars that are not red.

Now, let's draw a Venn diagram to visualize the situation:

[asy]
unitsize(0.05cm);
label("Red cars", (2,74));
label("4-door cars", (80,74));
draw(Circle((30,45), 22));
draw(Circle((58, 45), 22));
label("White 2-door cars: 8",(44,10));
label("$x$", (44, 45));
label(scale(0.8)*"$10-x$",(28,58));
label(scale(0.8)*"$15-x$",(63,58));
[/asy]

Now, let's add all four categories:

$(10-x)+x+(15-x) + 8 = 30$

Simplifying gives $33-x = 30$, so $x = 3$.

Therefore, there are $3$ 4-door and red cars in the parking lot.

